import './MyInfo';

function MyInfo() {
  return (
    <div>
      <h1>Alex hrebtsov</h1>
      <p>This is a paragraph about me... More reandom info about me added.</p>
      <ul>
        <li>USA</li>
        <li>Canada</li>
        <li>India</li>
      </ul>
    </div>
  );
}

export default MyInfo;
